--## remove voucher_mode column
alter table print_template
    drop column if exists voucher_mode;
--## add template column
alter table print_template
    add column if not exists template text;
--##
alter table print_template
    add column if not exists is_default bool not null default false;
--## add type column
alter table print_template
    add column if not exists type text;
--## set type to LABEL or PRINT depending on layout
update print_template SET "type"='LABEL' where layout in ('RACK','BATCH','CHEQUE_BOOK','GIFT_VOUCHER_COUPON');
--## set type to LABEL or PRINT depending on layout
update print_template SET "type"='VOUCHER' where layout not in ('RACK','BATCH','CHEQUE_BOOK','GIFT_VOUCHER_COUPON');
--##
alter table print_template alter "type" set not null;
--##
alter table print_template
    add constraint print_template_layout_fkey foreign key (layout) references print_layout;
--##
alter table print_template
    add constraint unique_name_per_layout unique (layout, name);
--##
insert into print_template(name, layout, template, type, is_default, created_at,updated_at,created_by,updated_by)
select concat('default ',replace(lower(id), '_',' ')) as name, id, template, type, true,current_timestamp, current_timestamp, 1,1
from print_layout;
--##
update print_template set template=config where type='LABEL' and template is null;
--##
--## remove config column
alter table print_template drop column if exists config;
-- run respective org print_template migration
--##
update print_template set template=''
where name='smSaleA4';
--##
--after adding a template for each org
alter table print_template alter template set not null;
